	id_tip_con_pac integer DEFAULT nextval('tipos_consultas_pacientes_id_tip_con_pac_seq'::regclass) NOT NULL,
	id_tip_con integer NOT NULL,
	id_his integer NOT NULL,
	otr_tip_con varchar(50),
	CONSTRAINT tipos_consultas_pacientes_pkey PRIMARY KEY (id_tip_con_pac),
	CONSTRAINT tipos_consultas_pacientes_unique UNIQUE (id_tip_con, id_his),
	CONSTRAINT tipos_consultas_pacientes_id_tip_con_fkey FOREIGN KEY (id_tip_con)
		REFERENCES tipos_consultas (id_tip_con)
		ON DELETE CASCADE
		ON UPDATE CASCADE,
	CONSTRAINT tipos_consultas_pacientes_id_his_fkey FOREIGN KEY (id_his)
		REFERENCES historiales_pacientes (id_his)
		ON DELETE CASCADE
		ON UPDATE CASCADE
)
TABLESPACE saib;
COMMENT ON COLUMN tipos_consultas_pacientes.id_tip_con_pac IS 'Id tipos de consulta paciente';
COMMENT ON COLUMN tipos_consultas_pacientes.id_tip_con IS 'Id tipos de consulta';
COMMENT ON COLUMN tipos_consultas_pacientes.id_his IS 'Id historico';
COMMENT ON COLUMN tipos_consultas_pacientes.otr_tip_con IS 'Otro tipo de consulta';

ALTER TABLE tipos_consultas_pacientes OWNER TO postgres;

